    of $1,992.42.  The vendor for this IE charged $2,500 in advance, but the IE ended
    up only costing $1,992.42.  The balance of the initial charge is being refunded
    in (and will be reported in) the next reporting period.  (2)  A roundtrip airport
    shuttle reservation for $90.50 that was prepaid was cancelled with a full refund.
    \ However, the vendor issued the refund in 2 seperate transactions ($40.25 and
    $50.25), representing each one-way leg of the roundtrip purchase.  Each refund
    transaction was reported seperately (each with memo text).\n"
